                <ul className='flex space-x-5 bg-red-500'>
                    <li className=''>
                        Header 1
                    </li>
                    <li className=''>
                        Header 2
                    </li>
                    <li className=''>
                        Header 3
                    </li>
                </ul>

            </nav>
        </header>
    );
};

export default Header;
